import styled from 'styled-components';

export const HeaderStyled = styled.div`
  nav {
    width: 100%;

    ul {
      width: 100%;
      display: flex;
      justify-content: space-evenly;
      margin: 0;
      padding: 0;

      li {
        list-style: none;
        width: auto;
        height: 50px;

      }
    }
  }
`;
